import '../Styles/App.css';
import Footer from './Footer';
import Header from './Header';
import TreeOnTreeGame from './TreeOnTreeGame';
import {Link} from 'react-router-dom';

function Home() {
  return (
    <div className="App"> 
      <h1>Memory game</h1>
      <Header />
        <div className="row">
            <Link to="/treeontreegame"> 3x3</Link>
        </div>
      <Footer />
    </div>
  );
}

export default Home;
